INSERT INTO public."_SearchParam" VALUES (1680, 'MolecularSequence', 'chromosome-variant-coordinate', 'http://hl7.org/fhir/SearchParameter/MolecularSequence-chromosome-variant-coordinate', 'Search parameter by chromosome and variant coordinate. This will refer to part of a locus or part of a gene where search region will be represented in 1-based system. Since the coordinateSystem can either be 0-based or 1-based, this search query will include the result of both coordinateSystem that contains the equivalent segment of the gene or whole genome sequence. For example, a search for sequence can be represented as `chromosome-variant-coordinate=1$lt345$gt123`, this means it will search for the MolecularSequence resource with variants on chromosome 1 and with position >123 and <345, where in 1-based system resource, all strings within region 1:124-344 will be revealed, while in 0-based system resource, all strings within region 1:123-344 will be revealed. You may want to check detail about 0-based v.s. 1-based above.', 5, NULL, 'MolecularSequence.variant', true, 0, 'MolecularSequence-chromosome-variant-coordinate', '2', '2019-04-25 12:57:55.265157', 'PyroServerSystem', '2019-04-25 12:57:55.265157', 'PyroServerSystem');
INSERT INTO public."_SearchParam" VALUES (1681, 'MolecularSequence', 'chromosome-window-coordinate', 'http://hl7.org/fhir/SearchParameter/MolecularSequence-chromosome-window-coordinate', 'Search parameter by chromosome and window. This will refer to part of a locus or part of a gene where search region will be represented in 1-based system. Since the coordinateSystem can either be 0-based or 1-based, this search query will include the result of both coordinateSystem that contains the equivalent segment of the gene or whole genome sequence. For example, a search for sequence can be represented as `chromosome-window-coordinate=1$lt345$gt123`, this means it will search for the MolecularSequence resource with a window on chromosome 1 and with position >123 and <345, where in 1-based system resource, all strings within region 1:124-344 will be revealed, while in 0-based system resource, all strings within region 1:123-344 will be revealed. You may want to check detail about 0-based v.s. 1-based above.', 5, NULL, 'MolecularSequence.referenceSeq', true, 0, 'MolecularSequence-chromosome-window-coordinate', '2', '2019-04-25 12:58:11.754059', 'PyroServerSystem', '2019-04-25 12:58:11.754059', 'PyroServerSystem');
INSERT INTO public."_SearchParam" VALUES (1682, 'MolecularSequence', 'referenceseqid-variant-coordinate', 'http://hl7.org/fhir/SearchParameter/MolecularSequence-referenceseqid-variant-coordinate', 'Search parameter by reference sequence and variant coordinate. This will refer to part of a locus or part of a gene where search region will be represented in 1-based system. Since the coordinateSystem can either be 0-based or 1-based, this search query will include the result of both coordinateSystem that contains the equivalent segment of the gene or whole genome sequence. For example, a search for sequence can be represented as `referenceSeqId-variant-coordinate=NC_000001.11$lt345$gt123`, this means it will search for the MolecularSequence resource with variants on NC_000001.11 and with position >123 and <345, where in 1-based system resource, all strings within region NC_000001.11:124-344 will be revealed, while in 0-based system resource, all strings within region NC_000001.11:123-344 will be revealed. You may want to check detail about 0-based v.s. 1-based above.', 5, NULL, 'MolecularSequence.variant', true, 0, 'MolecularSequence-referenceseqid-variant-coordinate', '2', '2019-04-25 12:58:29.711779', 'PyroServerSystem', '2019-04-25 12:58:29.711779', 'PyroServerSystem');
INSERT INTO public."_SearchParam" VALUES (1683, 'MolecularSequence', 'referenceseqid-window-coordinate', 'http://hl7.org/fhir/SearchParameter/MolecularSequence-referenceseqid-window-coordinate', 'Search parameter by reference sequence and window. This will refer to part of a locus or part of a gene where search region will be represented in 1-based system. Since the coordinateSystem can either be 0-based or 1-based, this search query will include the result of both coordinateSystem that contains the equivalent segment of the gene or whole genome sequence. For example, a search for sequence can be represented as `referenceSeqId-window-coordinate=NC_000001.11$lt345$gt123`, this means it will search for the MolecularSequence resource with a window on NC_000001.11 and with position >123 and <345, where in 1-based system resource, all strings within region NC_000001.11:124-344 will be revealed, while in 0-based system resource, all strings within region NC_000001.11:123-344 will be revealed. You may want to check detail about 0-based v.s. 1-based above.', 5, NULL, 'MolecularSequence.referenceSeq', true, 0, 'MolecularSequence-referenceseqid-window-coordinate', '2', '2019-04-25 12:58:46.967464', 'PyroServerSystem', '2019-04-25 12:58:46.967464', 'PyroServerSystem');
